import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";
import CreateArea from './CreateArea';


function App() {
    return <div>
        <Header></Header>
        
        {notes.map(notes =>
            <Note
                title={notes.title}
                content={notes.content}
                key={notes.id}>
            </Note>)}
        <Footer></Footer>
    </div>
}

export default App;
